import Header from './Header'
import Home from './Home'
import About from './About'
import './style/App.scss'
import { forwardRef } from 'react'
const App = forwardRef((props, ref) =>{
  return (
      <div>
        <Header ref={ref}/>
        <Home ref={ref}/>
        <About ref={ref}/>
      </div>
  );
}) 

export default App;
